Strict alternation relies on a variable, say turn, to control which process can run at any moment in time. At the end of its critical section, a process will update the turn variable to indicate it is done. For example, assume there are two processes A and B which have an overlapping critical section: // ... char turn = 'A'; void process_work_a() { while (true) { while (turn != 'A') {} // empty loop to await turn critical_section(); // enter critical_section turn = 'B'; // leave critical_section non_critical_section_a(); // non-critical section }
} void process_work_b()(void *arg) { while (true) { while (turn != 'B') {} critical_section(); turn = 'A'; non_critical_section_b(); }
} This fixes the problem of having to turn off interrupts, but it also introduces new problems: if it is process A's turn, but it is in its non-critical section, it can take as long as it wants / never enter its critical section again. B will be stuck waiting for A, which breaks two rules: that no process should be able to prevent another process from entering its critical section that if no process is in its critical section, and process attempting to enter its critical section should be allowed to do so immeditately. depending on the behaviour of non_critical_section_a, it could potentially break a third rule: that no process should be waiting to enter its critical section forever. process B is unable to enter its critical section twice in a row as it is forced to wait for process A to update turn.

