A lock (also known as mutex ) is a piece of data that restricts access to a certain resource. A process can: "acquire" a lock, preventing any other process from accessing the data associated with the lock. "release" it, allowing the next process to acquire it. Locks are purely symbolic as nothing forces a process to acquire a lock before accessing the protected data. An example of how we would use these locks would be: int *accounts;
